import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <>
      <p>
        <a href="#">Home</a>
      </p>
      <p>
        <a href="#">What is Gpt-3?</a>
      </p>
      <p>
        <a href="#">Open AI</a>
      </p>
      <p>
        <a href="#">Case Studies</a>
      </p>
      <p>
        <a href="#">Library</a>
      </p>
    </>
  );
};

export default Menu;
